let ProductItem = function ({product}) {
    let css = {
        display: "flex",
        flexWrap: "wrap",
        backgroundColor: "red",
    }
    
    let cssImage = {
        height: "auto",
        width: "170px"
    }
    
    return (
        <product-item>
            <img  style={cssImage} src={product.image}></img>
            <div>
                <h1>{product.title}</h1>
                <h3>{product.price}</h3>    
            </div>
               
        </product-item>
    )
};

export default ProductItem;
